import { Cell } from "./DayStyle"
import { Row } from "./DayStyle"
import { Day } from "./DayStyle"
import moment from "moment"
import { CurrentDay } from "./DayStyle"

function getDay(day) {
    return day.format('D');
}

function equalsDays(day, currentDay) {
    if(day.month() === currentDay.month()) {
        return day.date() === currentDay.date();
    }
    return false;
}

function isCurrentDay(day) {    
    if(moment().isSame(day, 'day')) {
        return (
            <CurrentDay>{getDay(day)}</CurrentDay>
        );
    } else {
        return getDay(day);
    }
}


export function DaySell({day, currentDay}) {
    return (
        <Cell
            weekend={day.day() === 6 || day.day() === 0}
        >
            <Row
                justify={'flex-end'}
            >
                <Day>
                    {isCurrentDay(day)}
                </Day>
            </Row>
        </Cell>
    )
}
